CREATE PROCEDURE `GetAveragePriceMileageByMake`(in vehicle_make varchar(20))
BEGIN
	select 
		Concat(floor((AllClosedListings.price ) / 10000) * 10000, ' - ', 
			floor(((AllClosedListings.price ) / 10000) + 1) * 10000) as price_bracket,
		avg(AllClosedListings.price) as AvgListPrice,
		avg(Purchase.price) as AvgPurchasePrice,
		(avg(AllClosedListings.price) - avg(Purchase.price)) AvgPriceDifference,
        avg(Vehicle.mileage)
	from 
		AllClosedListings join Purchase on AllClosedListings.listing_num = Purchase.listing_num
		join Vehicle on AllClosedListings.vehicle_num = Vehicle.vehicle_num
    where Vehicle.make = vehicle_make
	group by price_bracket order by price_bracket;
END ;;
