CREATE PROCEDURE `GetAveragePriceTrendByMake_LastYear`(in vehicleMake varchar(45))
BEGIN
	select 
		Vehicle.make,
		month(AllOpenListings.date) as 'Month',
		avg(AllOpenListings.price) as 'Average List Price'
	from 
		AllOpenListings join Vehicle on AllOpenListings.vehicle_num = Vehicle.vehicle_num 
	where 
		AllOpenListings.date >= date_sub(curdate(), interval 1 year) and
		AllOpenListings.date <= curdate() and
        Vehicle.make = vehicleMake
	group by Vehicle.make, month(AllOpenListings.date)
	order by Vehicle.make, month(AllOpenListings.date) asc;
END ;;
