CREATE PROCEDURE `GetMostViewedMake`(in daysInterval int, in numResults int)
BEGIN
select 
	Vehicle.make, 
    sum(View.times_viewed) Total_Views 
from View join Listing on View.listing_num = Listing.listing_num
join Vehicle on Listing.vehicle_num = Vehicle.vehicle_num 
where 
	Listing.date < curdate() 
    and Listing.date > date_sub(curdate(), interval daysInterval day)
group by Vehicle.make order by Total_Views desc limit numResults;
END ;;
